import React from 'react'
import {Layout} from "../../containers/Layout";
import api from "../../services/api";
import {Link} from "react-router-dom";

 export default function Home() {
    async function getAll() {
        let res =  api.users.fetchAll();
        return res;
    }

    return (
        <div>
            getAll()
        </div>
    )
}
